import YouTube from "../APIs/YouTube";

const useVideos = () => {
  const [videos, setVideos] = useState([])

  useEffect(()=> {
    onValueSubmit('Happy')
  }, [])

  const onValueSubmit = async value => {
    const response = await YouTube.get('/search', {
      params: {
        q: value
      }
    })
    setVideos(response.data.items)
  }
}

export default useVideos;
